import React from 'react';
import IconButton from '@mui/material/IconButton';
import Button from '@mui/material/Button';
import './App.css';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import AirplanemodeActiveIcon from '@mui/icons-material/AirplanemodeActive';
import AlarmIcon from '@mui/icons-material/Alarm';
import ButtonGroup from '@mui/material/ButtonGroup';
import Checkbox from '@mui/material/Checkbox';
import BookmarkBorderIcon from '@mui/icons-material/BookmarkBorder';
import BookmarkIcon from '@mui/icons-material/Bookmark';
import Fab from '@mui/material/Fab';
import EditIcon from '@mui/icons-material/Edit';
import Rating from '@mui/material/Rating';
function App() {
  return (
    <div className="App">
      <Button variant="text" color="primary" size="large">Text</Button>
      <Button variant="contained" startIcon={<AcUnitIcon />} color="secondary">Contained</Button>
      <Button variant="outlined" color="success" endIcon={<AirplanemodeActiveIcon/>}  size="small">Outlined</Button>
      <IconButton color="warning" aria-label="add an alarm">
  <AlarmIcon />
</IconButton>
      <br>
      </br>
      <ButtonGroup variant="contained" aria-label="outlined primary button group">
      <Button>One</Button>
      <Button>Two</Button>
      <Button>Three</Button>
    </ButtonGroup>

    <ButtonGroup orientation='vertical' variant="outlined" aria-label="button group" color="success">
      <Button>One</Button>
      <Button>Two</Button>
      <Button>Three</Button>
    </ButtonGroup>

        <Checkbox color='warning'
    icon={<BookmarkBorderIcon />}
    checkedIcon={<BookmarkIcon />}
    />

    <Fab color="secondary" aria-label="edit" size="small">
        <EditIcon />
      </Fab>

    <br></br>
    <Rating name="half-rating" defaultValue={2.5} precision={0.5} />
    </div>


  );
}

export default App;
